import React, { Component } from 'react';

class Heading extends Component {

    render() {
        return (
            <div>
                <img src="/logo/searchIcon.png" />
                <p>https://wesearchinc.com</p>
                <h1>React.js Assessment</h1>
                <h2>Front End Developer</h2>
            </div>
        )
    }

}

export default Heading;
